import React from "react";
import { Button, Grid, TextField, Stack, Container } from "@mui/material";
import "./index.css";

function Login() {
  return (
      <Grid sx={{ background: "yellow" }}
      container
      direction="column"
      justifyContent="center"
      alignItems="center">
        <Stack spacing={3} >
          <TextField
            fullWidth
            id="outlined-basic"
            label="Username"
            variant="outlined"
          />
          <TextField
          sx={{input: {textAlign: "center"}}}
            id="outlined-password-input"
            label="Password"
            type="password"
          />
          <Button fullWidth variant="contained">
            Login
          </Button>
        </Stack>
      </Grid>
  );
}

export default Login;
